 *   <script>
 * 
 *     class MyFeed extends v9.feed {
 *       onOpen(pMeta) {
 *       }
 *
 *       onLoad () {
 *       }
 *
 *       onStop () {
 *       }
 *
 *       onRender () {
 *       }
 * 
 *       onEvent(pSymbol, pEvent, pRealTime) {
 *       }
 *     }
 *
 *     let	feed = new MyFeed(new v9.edit().symbol);
 *   </script>
 * </head>
 * <style>
 *   html, body, #container {
 *     width: 100%;
 *     height: 100%;
 *     margin: 0;
 *     padding: 0;
 *   }
 * </style>
 * <body>
 *   <div id="container"></div>
 * </body>
 * </html>
 *

